import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import { NavBar } from "./components/NavBar";
import { Landingpage } from "./components/Landingpage";
import { Skills } from "./components/Skills";
function App() {
  return (
    <div className="App">
      <NavBar />
      <Landingpage />
      <Skills />
    </div>
  );
}

export default App;
